import React from 'react';
import PropTypes from 'prop-types';

const Title = ({ label }) => (
  <h1>
    {' '}
    {label}
    {' '}
  </h1>
);

Title.defaultProps = {
  label: 'ToDoS',
};
Title.propTypes = {
  label: PropTypes.string.isRequired,
};

export default Title;
